import s from './Messages.module.css';
import {NavLink} from "react-router-dom";

const DialogItem = (props) => {
    let path = '/messages/' + props.id;
    return (
        <div className={s.dialog + ' ' + s.active}>
            <NavLink to={path}>{props.name}</NavLink>
        </div>
    )
}

const Message = (props) => {
    return (
        <div className={s.message}>{props.message}</div>
    )
}

const Messages = (props) => {
    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItems}>
                <DialogItem name='David Bowie' id='david'/>
                <DialogItem name='Group Queen' id='queen'/>
                <DialogItem name='Kanye West' id='kenye'/>
            </div>


            <div className={s.messages}>
                <div className={s.message}>Pressure pushing down on me</div>
                <div className={s.message}><p>Pressing down on you, no man ask for</p></div>
                <div className={s.message}><p>Um ba ba be</p></div>
            </div>

        </div>
    )
}

export default Messages;
